import React from 'react';
import PeopleCard from './PeopleCard'



const PeopleList = ({array2}) => {

	return (

		<div>
		{ 
			
			array2.map((heros,i) => {
				return (
					<PeopleCard
					key={i}
					name={array[i].name}
					gender={array[i].gender}
					height={array[i].height}
					mass={array[i].mass}
					/>

					);
			})

		}
		</div>
		)
		}


export default PeopleList
